<style>

#whites path, #drum path, .twoseven { fill: #474747; stroke: #474747;}
.biggie { z-index: 700;}
.boxer { position: relative; overflow: hidden; transition: all 0.8s var(--cube1) 0.2s; border: 1px solid #d7d7d7;}
.boxer span { position: absolute; top: 0; left: 0;}
.typ1 { border-top: 1px solid #fe4a49;}
.typ2 { border-right: 1px solid #fe4a49; width: 100%; }
.typ3 { border-bottom: 1px solid #fe4a49; height: 100%;}
.typ4 { border-left: 1px solid #fe4a49;}
.boxer, .logo-svg-box { justify-content: center; align-items: center;}
.biggie .col1, .biggie .col2, .biggie .col3 { display: flex; flex-direction: column;}

.boxer:hover .typ1 { animation: typ1 0.4s var(--cube1) forwards;}
.boxer:hover .typ2 { animation: typ2 0.54s var(--cube2) forwards;}
.boxer:hover .typ3 { animation: typ3 0.7s var(--cube3) forwards;}
.boxer:hover .typ4 { animation: typ4 0.5s var(--cube4) forwards;}
.boxer:hover { animation: redlines 1.5s var(--cube2) 0.5s forwards; }

.col1 .boxer, .col3 .boxer { width: 80%;}
.bigbox, .col2 { overflow: visible;}


@keyframes typ1 {
	0% { width: 0%; margin-left: 0; }
	50% { width: 100%; margin-left: 0;}
	100% { width: 100%; margin-left: 100%;}
}

@keyframes typ2 {
	0% { height: 0; margin-top: 0;}
	50% { height: 100%; margin-top: 0;}
	100% { height: 100%; margin-top: 100%;}
}

@keyframes typ3 {
	0% { width: 100%; margin-left: 100%;}
	50% { width: 100%; margin-left: 0;}
	100% { width: 0; margin-left:0;}
}

@keyframes typ4 {
	0% { height: 100%; margin-top: 100%;}
	50% { height: 100%; margin-top: 0;}
	100% { height: 0; margin-top: 0;}
}

@keyframes redlines {
 0% { border: 1px solid var(--green);}
100% { border: 1px solid #fe4a49;}
}

#edge8, #edge7, #edge6, #edge4, #edge3, #edge2, #edge1, #edge5 {
	transition: all 1.2s var(--cube3);
}

#dottedcircles {
	transform-origin: center center;
}

.bigbox:hover #dottedcircles { animation: isrotating 4s var(--cube2) infinite;}

@keyframes isrotating {
	0% { transform: rotate(0deg);}
	50% { transform: rotate(360deg);}
	100% { transform: rotate(0deg);}
}


#edges { 
	transform-origin: center center;
	overflow: visible;
	transition: all 1.7s var(--cube1);
	z-index: 20;
}

.logo-svg-box:hover #edges {
	transform: scale(1.2);
}

.logo-svg-box:hover #inn path {
	animation: recolor 0.46s var(--cube2) forwards;
}

.logo-svg-box:hover #mid path {
	animation: recolor 0.7s var(--cube3) 0.46s forwards;
}

.logo-svg-box:hover #outermost path {
	animation: recolor 0.6s var(--cube4) 1.2s forwards;
}

@keyframes recolor {
	0% { fill: transparent;}
100% { fill: #fe4a49;}
}

#inn path, #mid path, #outermost path, #core path {
	fill: transparent;
}


.boxer, .logo-svg-box { justify-content: center; align-items: center;}
.logo-svg-box svg { margin-left: auto; margin-right: auto;}

@media screen and ( min-width: 900px ) {
	.biggie { width: 100vw; height: 100vh; padding-left: 4vw; padding-right: 4vw; justify-content: center; gap: 2em;}
	.col1 { width: 30vw; padding: 0; justify-content: center; align-items: center; gap: 3em; padding-bottom: 4em; }
	.col2 { width: 30vw; padding: 0; justify-content: flex-end; align-items: center; padding-bottom: 4em; gap: 0;}
	.col3 { width: 30vw; padding: 0; justify-content: center; align-items: center;gap: 3em; padding-bottom: 4em;}
	.boxer { border-radius: 4px; height: 16vh;}
	.boxer span { border-radius: 4px;}
	.of-dra { padding-top: 1em;}
	#soalogo { width: 30vw;}
	.box-of-mrd svg, .box-of-fm { object-fit: cover; width: 100%;}
	.box-of-mrd { padding: 0 12%;}
	.box-of-fm { padding: 0 8%;}
	.box-of-fm svg { margin-top: 20%; transform: translateY(-50%);}
}

@media screen and ( max-width: 899px) and (min-width: 768px) {
	.biggie { width: 100vw; height: 100vh; padding-left: 4vw; padding-right: 4vw; justify-content: center; gap: 2em;}
	.col1 { width: 30vw; padding: 0; justify-content: center; align-items: center; gap: 2em; }
	.col2 { width: 40vw; padding: 0; justify-content: flex-end; align-items: center; padding-bottom: 4em; gap: 1em;}
	.col3 { width: 30vw; padding: 0; justify-content: center; align-items: center; gap: 2em;}
	.boxer { padding: 0.5em 1em; border-radius: 4px; height: 15vh; justify-content: center;}
	.boxer span { border-radius: 4px;}
	.of-dra { padding-top: 1em;}
	#soalogo { width: 24vw;}
	.bigbox { height: 420px;}
}

@media screen and (max-width: 767px) and (min-width: 576px) {
	.biggie { width: 100vw; height: 100%; justify-content: center; gap: 1em;}
	.col1 { width: 100vw; padding: 3em 2vw; justify-content: center; align-items: center; gap: 3em;}
	.col2 { width: 100vw; padding: 3em 2vw; justify-content: center; align-items: center; gap: 3em; }
	.col3 { width: 100vw; padding: 1em 2vw 3em 2vw; justify-content: center; align-items: center; gap: 3em;}
	.boxer { padding: 1em; border-radius: 4px; height: 200px; justify-content: center;}
	.boxer span { border-radius: 4px;}
	.of-dra { padding: 0.2em;}
	.bigbox { width: 100%; margin-bottom: 2em;}
